import React from 'react'
import { WhitePortfolioContainer, RedHeaderBox } from '../lib/container'
import { BoxHeader } from '../lib/text'

export const ForMore = () => {
  return (
    <WhitePortfolioContainer>
      <RedHeaderBox>
        <BoxHeader>FOR MORE</BoxHeader>
      </RedHeaderBox>
    </WhitePortfolioContainer>
  )
}

export default ForMore
